import React from 'react';
import ReactDOM from 'react-dom';


const Hello = (props) => {
  return (
    <div>
      <p>Hello {props.name}</p>
    </div>
  )
}




const App = () => {
  return (
    <div>
      <h1>Greerings</h1>
      <Hello name="George"/>
      <Hello name="Mike"/>
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'))
